import AuthNavbar from "../Layouts/AuthNavbar";
import AuthFooter from "../Layouts/AuthFooter";

const UserDashboard = () => {
  return (
    <div>
      <AuthNavbar />
      <div class="container w-full p-20 m-4 mx-auto my-16 text-center bg-white border-2 border-gray-300 border-dashed h-96 rounded-xl">
        <p class="mt-20 italic text-gray-500 text-md">-- Content of your page --</p>
      </div>
      <AuthFooter />
    </div>
  )
}

export default UserDashboard;
